import React from "react";
import { TableRow, TableCell } from "@mui/material";

function Customer(props) {
  return (
    <div>
      <CustomerProfile id={props.id} image={props.image} name={props.name} />
      <CustomerInfo
        birthday={props.birthday}
        gender={props.gender}
        job={props.job}
      />
    </div>
  );
}

<div>
  <CustomerProfile id={props.id} image={props.image} name={props.name} />
  <CustomerInfo
    birthday={props.birthday}
    gender={props.gender}
    job={props.job}
  />
</div>;

